import React, { useState, useEffect, useRef } from 'react';
import './App.css';
import StrategyHeatmap from './components/StrategyHeatmap';
import ScoreChart from './components/ScoreChart';
import MarketSection from './components/MarketSection';

function App() {
  const [environment, setEnvironment] = useState('prod');
  const [marketData, setMarketData] = useState({});
  const [scoreHistory, setScoreHistory] = useState([]);
  const [connectionStatus, setConnectionStatus] = useState('DISCONNECTED');
  const [lastUpdate, setLastUpdate] = useState(null);
  const wsRef = useRef(null);

  const websocketUrl = environment === 'local' 
    ? 'ws://localhost:8765' 
    : 'ws://134.209.184.5:8765';

  useEffect(() => {
    const connect = () => {
      if (wsRef.current) {
        wsRef.current.close();
      }

      console.log(`üîå Connecting to ${websocketUrl}`);

      try {
        const ws = new WebSocket(websocketUrl);

        ws.onopen = () => {
          console.log('‚úÖ Connected successfully!');
          setConnectionStatus('Connected');
          ws.send(JSON.stringify({ type: 'get_latest' }));

          // Periodic requests every 5 seconds
          const interval = setInterval(() => {
            if (ws.readyState === WebSocket.OPEN) {
              ws.send(JSON.stringify({ type: 'get_latest' }));
            }
          }, 5000);

          ws.interval = interval;
        };

        ws.onmessage = (event) => {
          try {
            const data = JSON.parse(event.data);
            console.log('üì¶ Received data with keys:', Object.keys(data));
            console.log('üìã Full data structure:', data);

            if (data.type === 'pong') return;

            // Check for different data structures
            if (data.data) {
              console.log('üîç Found data.data with keys:', Object.keys(data.data));
              if (data.data.signals_by_tag_and_direction_and_market) {
                console.log('‚úÖ Found heatmap data in data.data');
              }
            }

            if (data.signals_by_tag_and_direction_and_market) {
              console.log('‚úÖ Found heatmap data at root level');
            }

            // Store the complete data object
            setMarketData(data);
            setLastUpdate(new Date());

            // Update score history for chart
            updateScoreHistory(data);

          } catch (error) {
            console.error('‚ùå Error processing data:', error);
          }
        };

        ws.onerror = (error) => {
          console.error('‚ùå WebSocket error:', error);
          setConnectionStatus('ERROR');
        };

        ws.onclose = (event) => {
          console.log('üîå WebSocket closed:', event.code);
          setConnectionStatus('DISCONNECTED');
          if (ws.interval) clearInterval(ws.interval);

          // Reconnect after delay
          setTimeout(() => {
            connect();
          }, 5000);
        };

        wsRef.current = ws;
      } catch (error) {
        console.error('‚ùå Failed to connect:', error);
        setConnectionStatus('ERROR');
      }
    };

    connect();

    return () => {
      if (wsRef.current) {
        if (wsRef.current.interval) {
          clearInterval(wsRef.current.interval);
        }
        wsRef.current.close();
      }
    };
  }, [websocketUrl]);

  const updateScoreHistory = (data) => {
    // Extract score data from active_signals_score_by_market
    if (data.data && data.data.active_signals_score_by_market) {
      const scoreData = data.data.active_signals_score_by_market;
      console.log('üìä Score data:', scoreData);

      // Get NQ score (or first available market)
      const nqScore = scoreData.NQ;
      const firstMarketScore = nqScore || Object.values(scoreData)[0];

      if (firstMarketScore !== undefined) {
        console.log('üìà Using score:', firstMarketScore);

        setScoreHistory(prev => {
          const newEntry = {
            timestamp: new Date(),
            score: firstMarketScore,
            longScore: 0, // We don't have individual long/short from this data
            shortScore: 0
          };

          // Debug: Check for unexpected 0 values
          if (firstMarketScore === 0) {
            console.warn('‚ö†Ô∏è Got 0 score! Full score data:', scoreData);
          }

          // Add entry every time to show time progression, but limit frequency
          const lastEntry = prev[prev.length - 1];
          const now = new Date();

          // Only add if at least 3 seconds have passed since last entry
          if (lastEntry) {
            const timeDiff = now - lastEntry.timestamp;
            if (timeDiff < 3000) { // 3 seconds
              console.log('üîÑ Skipping - too recent (', timeDiff, 'ms)');
              return prev;
            }
          }

          console.log('‚ûï Adding new score entry:', newEntry);
          const newHistory = [...prev, newEntry];

          // Keep only last 5 minutes of data
          const fiveMinutesAgo = new Date(Date.now() - 5 * 60 * 1000);
          return newHistory.filter(item => item.timestamp > fiveMinutesAgo);
        });
      }
    } else {
      console.log('‚ùå No active_signals_score_by_market found');
    }
  };

  const formatTime = (date) => {
    if (!date) return '--:--:--';
    return date.toLocaleTimeString();
  };

  return (
    <div className="app">
      <header className="app-header">
        <h1>ImpViz Active Trader</h1>
        <div className="connection-info">
          <div className={`status-indicator ${connectionStatus.toLowerCase()}`}>
            <span className="status-dot"></span>
            <span>{connectionStatus}</span>
          </div>
          <div className="last-update">
            Last Update: {formatTime(lastUpdate)}
          </div>
          <button 
            className="env-toggle"
            onClick={() => setEnvironment(env => env === 'prod' ? 'local' : 'prod')}
          >
            {environment === 'prod' ? 'Production' : 'Local'}
          </button>
        </div>
      </header>

      {/* Strategy Metrics Heatmap */}
      <StrategyHeatmap data={marketData} />

      {/* Score Trend Chart */}
      <ScoreChart 
        scoreHistory={scoreHistory} 
        onClearHistory={() => setScoreHistory([])}
      />

      {/* Market Data Section */}
      <MarketSection data={marketData} />
    </div>
  );
}

export default App;
